import ItemCategory from "./itemCategory";
import ItemShowcase from "./itemShowcase";
import ItemTicket from "./itemTicket";

abstract class Item {
  id: number;
  title: string;
  price: number;
  pictureUrl: string;
  category: ItemCategory;

  constructor(id: number, title: string, price: number, pictureUrl: string, category: ItemCategory) {
    this.id = id;
    this.title = title;
    this.price = price;
    this.pictureUrl = pictureUrl;
    this.category = category;
  }

}

export default Item;
